import React from 'react';
import ReactDOM from 'react-dom';


function BookList() {
    return (
        <>
            <Book />
        </>
    )
}

const Book = () => {
    return (
        <article>
            <Image />
            <Title />
        </article>
    )
}

const Image = () => <img src='https://www.slashfilm.com/wp/wp-content/images/terminator-6-direction.jpg' alt='' />

const Title = () => <h1>Terminator</h1>

const Author = () => <h1> James Cameron</h1>

ReactDOM.render(
    <>
        <Book />

    </>

    ,
    document.getElementById('root')
)
